(1, 'invoice_mail', 'Invoice no {{invoice_no}} of {{customer}}', '<div style=\"width:80%; margin: 0 auto;background-color:#fff;\">\r\n        <table cellpadding=\"10\" cellspacing=\"0\" style=\"width: 100%;\">\r\n			<tbody>\r\n				<tr>\r\n					<td>\r\n						<p style=\"background-color: #fff;text-align:left;font-size:25px;border-radius:5px;\">Hello,</p>\r\n                        <p style=\"text-align:left;font-size:18px;padding-left: 45px;\">\r\n                        Our system has generated the invoice of {{customer}} with invoice no {{invoice_no}}\r\n                        <br/>\r\n                        <table width=\"600px\" height=\"100px\" cellspacing=\"0\" cellpadding=\"5\">\r\n                            <tbody>\r\n                                <tr>\r\n                                    <td><strong>Billed Amount</strong></td>\r\n                                    <td>{{billed_amount}}</td>\r\n                                </tr>\r\n                                <tr>\r\n                                    <td><strong>Billed Amount (in words)</strong></td>\r\n                                    <td>{{amount_words}}</td>\r\n                                </tr>\r\n                                <tr>\r\n                                    <td><strong>Bill Date</strong></td>\r\n                                    <td>{{bill_date}}</td>\r\n                                </tr>\r\n                            </tbody>\r\n                        </table></p>\r\n					</td>\r\n				</tr>\r\n				<tr>\r\n					<td style=\"background-color: #fff;text-align:left;font-size:25px;border-radius:5px;\">\r\n					Regards,<br />\r\n					<strong style=\"color:#cc0000 !important;text-decoration:none\"><a style=\"color:#cc0000 !important;text-decoration:none\">{{conpany_name}}</a> Team</strong></td>\r\n				</tr>\r\n				<tr>\r\n					<td style=\"width:96%; margin: 0 auto; padding:18px;background-color:#efefef; height:30px; color:#949494; font-size:12px; font-family: Arial, Helvetica, sans-serif;  font-weight:bold; vertical-align:middle;text-align: center;\" > \r\n					<p>This is a computer auto generated message. Please do not reply to this message.</p>\r\n					</td>\r\n				</tr>\r\n			</tbody>\r\n		</table>\r\n    </div>', '2019-10-03 00:11:55', '2019-10-03 00:11:55'),
