CREATE DEFINER=`root`@`localhost` PROCEDURE `Donut_chart` (IN `Id` INT, IN `FY_FROM` DATE, IN `FY_TO` DATE)  SELECT 
(
SELECT COUNT(id) FROM invoice WHERE user_id = Id AND status = 'Pending' AND invoice_date BETWEEN FY_FROM AND FY_TO
) AS pending_invoice,
(
SELECT COUNT(id) FROM invoice WHERE user_id = Id AND status = 'Completed' AND invoice_date BETWEEN FY_FROM AND FY_TO
) AS completed_invoice,
(
SELECT count(p.id) FROM invoice i JOIN invoice_payments p
ON i.id = p.invoice_id
WHERE i.user_id = Id AND i.status = 'Pending' AND p.status = 'Completed' AND p.payment_date BETWEEN FY_FROM AND FY_TO
) AS part_completed_invoice$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `GetDashboard` (IN `Id` INT, IN `FY_FROM` DATE, IN `FY_TO` DATE)  BEGIN
SELECT
    (SELECT sum(`payed_amount`) as todays_sum FROM `invoice_payments`
    WHERE `user_id` = Id AND `Status` = 'Completed' AND 
    DATE_FORMAT(`payment_date`,'%y-%m-%d') = CURDATE() AND payment_date BETWEEN FY_FROM AND FY_TO) as todays_sum,

    (SELECT sum(`Balance_Amount`) as todays_pending_sum FROM `invoice`
    WHERE `user_id` = Id AND `Status` = 'Pending' AND 
    DATE_FORMAT(`invoice_date`,'%y-%m-%d') = CURDATE() AND invoice_date BETWEEN FY_FROM AND FY_TO) as todays_pending_sum,

    (SELECT sum(`payed_amount`) as overall_sum FROM `invoice_payments` 
    WHERE `user_id` = Id AND `Status` = 'Completed' AND payment_date BETWEEN FY_FROM AND FY_TO) as overall_sum,

    (SELECT sum(`Balance_Amount`) as pending_sum FROM `invoice` 
    WHERE `user_id` = Id AND `Status` = 'Pending' AND invoice_date BETWEEN FY_FROM AND FY_TO) as pending_sum,
    
    (SELECT sum(`payed_amount`) as overall_sum FROM `invoice_payments` 
    WHERE `user_id` = Id AND `Status` = 'Completed') as total_overall_sum,

    (SELECT sum(`Balance_Amount`) as pending_sum FROM `invoice` 
    WHERE `user_id` = Id AND `Status` = 'Pending') as total_pending_sum,
    
    (SELECT count(`id`) as no_of_invoices FROM `invoice` 
    WHERE `user_id` = Id AND `Status` != 'Cancelled' AND invoice_date BETWEEN FY_FROM AND FY_TO) as total_no_invoices,
    
    (SELECT sum(`Netammount`) as Netammount FROM `invoice` 
    WHERE `user_id` = Id AND `Status` != 'Cancelled' AND invoice_date BETWEEN FY_FROM AND FY_TO) as total_sales;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `GetGST` (IN `Id` INT, IN `FY_FROM` DATE, IN `FY_TO` DATE, IN `STATUS` VARCHAR(100))  BEGIN
IF STATUS = 'Pending' THEN 
   SELECT DISTINCT DATE_FORMAT(`invoice_date`,'%M %Y') AS Month, ROUND(sum(CGST),2) as CGST, ROUND(sum(SGST),2) as SGST, ROUND(sum(IGST),2) as IGST,ROUND(sum(CESS),2) as CESS, ROUND(sum(TCS),2) as TCS, ROUND(SUM((CGST)+ (SGST)+ (IGST)+ (CESS)+ (TCS)),2) AS `total_tax` FROM `invoice` WHERE user_id = Id AND `Status` = 'Pending' AND invoice_date BETWEEN FY_FROM AND FY_TO GROUP BY DATE_FORMAT(`invoice_date`,'%M %Y') ORDER BY DATE_FORMAT(`invoice_date`,'%Y %m') ASC;
END IF;
IF STATUS = 'Completed' THEN 
   SELECT DISTINCT DATE_FORMAT(`invoice_date`,'%M %Y') AS Month, ROUND(sum(CGST),2) as CGST, ROUND(sum(SGST),2) as SGST, ROUND(sum(IGST),2) as IGST,ROUND(sum(CESS),2) as CESS, ROUND(sum(TCS),2) as TCS, ROUND(SUM((CGST)+ (SGST)+ (IGST)+ (CESS)+ (TCS)),2) AS `total_tax` FROM `invoice` WHERE user_id = Id AND `Status` = 'Completed' AND invoice_date BETWEEN FY_FROM AND FY_TO GROUP BY DATE_FORMAT(`invoice_date`,'%M %Y') ORDER BY DATE_FORMAT(`invoice_date`,'%Y %m') ASC;
END IF;
IF STATUS = 'Cancelled' THEN 
   SELECT DISTINCT DATE_FORMAT(`invoice_date`,'%M %Y') AS Month, ROUND(sum(CGST),2) as CGST, ROUND(sum(SGST),2) as SGST, ROUND(sum(IGST),2) as IGST,ROUND(sum(CESS),2) as CESS, ROUND(sum(TCS),2) as TCS, ROUND(SUM((CGST)+ (SGST)+ (IGST)+ (CESS)+ (TCS)),2) AS `total_tax` FROM `invoice` WHERE user_id = Id AND `Status` = 'Cancelled' AND invoice_date BETWEEN FY_FROM AND FY_TO GROUP BY DATE_FORMAT(`invoice_date`,'%M %Y') ORDER BY DATE_FORMAT(`invoice_date`,'%Y %m') ASC;
END IF;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `UPDATEFY` ()  BEGIN
DECLARE n INT DEFAULT 0;
DECLARE i INT DEFAULT 0;
SELECT count(*) FROM users where role != 'Admin' INTO n;
SET i=0;
WHILE i<n DO 

IF MONTH(CURDATE()) = 4 THEN
UPDATE mst_financial_year SET status = 'Inactive' WHERE user_id = (SELECT id FROM users where role != 'Admin' LIMIT i,1);  

  SET i = i + 1;
END IF;
END WHILE;
End$$

